      ('EACEFE65-D4B1-4A22-BDFD-A22FF5880713','Katia Grammatico','katia@splendorsrl.it','','Fwd: invito corso formazione frizioni','2018-09-20 09:06:00','\n\n\n\n\n-------- Messaggio Inoltrato -------- \nOggetto: 	invito corso formazione frizioni	 \nData: 	Wed, 19 Sep 2018 16:38:54 +0200 (CEST)	 \nMittente: 	autoricambiemporio@libero.it <mailto:autoricambiemporio@libero.it> 	 \nA: 	autofficina500@gmail.com <mailto:autofficina500@gmail.com> , officina@euroracing.biz <mailto:officina@euroracing.biz> , infinitycar.torino@gmail.com <mailto:infinitycar.torino@gmail.com> , carrozzeriavistrorio@gmail.com <mailto:carrozzeriavistrorio@gmail.com> , info@ludo-car.it <mailto:info@ludo-car.it> , katia@splendorsrl.it <mailto:katia@splendorsrl.it> , lovera02@lovera.191.it <mailto:lovera02@lovera.191.it> , f.lli-goia@libero.it <mailto:f.lli-goia@libero.it> , f.lliperotti@gmail.com <mailto:f.lliperotti@gmail.com> , officinadiana2018@gmail.com <mailto:officinadiana2018@gmail.com> , autoriparazionifele@yahoo.it <mailto:autoriparazionifele@yahoo.it> , info@troianosnc.it <mailto:info@troianosnc.it> , massiimo.rizzi@fastwebnet.it <mailto:massiimo.rizzi@fastwebnet.it> , flinesrl@gmail.com <mailto:flinesrl@gmail.com> , info.rottamazioni@gmail.com <mailto:info.rottamazioni@gmail.com> 	 \n\n\n\nBuongiorno,\n\nla presente per informarVi che il 25 Settembre 2018 alle 19,30 la Cati SPA, in collaborazione con Autoricambi Emporio srl, terrà un corso :\n\n                     “sistemi frizioni per auto e veicoli leggeri”.\n\n\n\n\nDurante questo corso i tecnici della Schaeffler svilupperanno i seguenti temi:\n\n*	sistemi di disinnesto convenzionali\n*	disco e spingidisco\n*	frizione autoregolante SAC\n*	Moduli frizione Audi\n*	panoramica sul sistema doppia frizione\n*	problematiche installazione\n*	difetti tipici\n*	Garanzia\n\nVi invito a comunicarmi una conferma entro il 21/09/2018 \n\nQuesta l’agenda:\n\nritrovo in Cati ore 19.30\n\napericena dalle 19.30 alle 20.00\n\ninizio lavori ore 20.15\n\ntermine lavori ore 22..15\n\nGrazie Paolo.\n\n','08`````-%Q`K^S5T](CKV%%`QP4\'VD*"$`',0,TRUE,FALSE,FALSE,0,0,FALSE,1,1,0,'Officina02pc_Andrea',0),
